The provided code is quite long and complex, but here is a simplified version in Solidity:

```solidity
pragma solidity ^0.4.24;

contract Contract {
    mapping (address => uint256) public balanceOf;
    mapping (address => mapping (address => uint256)) public allowance;
    uint256 public totalSupply;
    address public owner;

    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value);
        require(balanceOf[_to] + _value >= balanceOf[_to]);

        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        return true;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= balanceOf[_from]);
        require(_value <= allowance[_from][msg.sender]);
        require(balanceOf[_to] + _value >= balanceOf[_to]);

        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    constructor(uint256 initialSupply) public {
        balanceOf[msg.sender] = initialSupply;
        totalSupply = initialSupply;
        owner = msg.sender;
    }
}
```

The above code represents a simple ERC20 token. The constructor sets the `totalSupply` and gives the initial supply to the contract creator. The `transfer` function allows a user to send tokens to someone else. The `approve` function allows a user to allow another user to spend a certain amount of tokens on their behalf. The `transferFrom` function allows a user to spend tokens on someone else's behalf, as long as they have been approved to do so.

This is a basic implementation and does not include any events, error messages, or safe math functions, which are typically included in an ERC20 token for a production environment. The contract also has no functionality for minting or burning tokens, which is often required in a token. It's worth noting that the provided decompiled code seems to contain additional functionality beyond the standard ERC20 interface, which I have not included in this simplified version.

